import React from 'react'
import CurrentMenuDescription from './CurrentMenuDescription'
import CurrentMenuItems from './CurrentMenuItems'

export default function CurrentMenu(props) {
    return (
        <div id="current_menu" className="vertical_container">            
            <CurrentMenuDescription key={props.CurrentMenu.title} title={props.CurrentMenu.title} description={props.menu.description}/>
            <CurrentMenuItems key={props.menu.title+"Items"} menuTitle={props.menu.title} menu={props.menu} open={props.open} close={props.close}/>
        </div>
    )
}
